import { Container, FormControl, InputBase, InputLabel, MenuItem, Select, styled, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

const FormOS = () => {

    const [age, setAge] = React.useState('');

    const handleChange = (event) => {
        setAge(event.target.value);
    };


    return (
        <Container>
            <Box>
                <FormControl sx={{ m: 1, minWidth: 120 }}>
                    <Select
                        value={age}
                        onChange={handleChange}
                        displayEmpty
                        inputProps={{ 'aria-label': 'Without label' }}
                    >
                        <MenuItem value={10}>Samuel Ximenes</MenuItem>
                        <MenuItem value={20}>Hamon Ravick</MenuItem>
                        <MenuItem value={30}>Italo Maciel</MenuItem>
                    </Select>
                </FormControl>
            </Box>
        </Container>
    )
}

export default FormOS
